import {makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles((theme)=>({
    Box:{
        marginTop:'20vh',
        marginBottom:'20vh'
    },
    img:{
        maxWidth:'100%'
    },
    firstgrid:{
        marginBottom:'10vh'
    },
    h2:{
        color:'green',
        letterSpacing:'.4rem',
        textAlign:'center'
    },
}))

export default useStyles
